// onResize()

menu.addEventListener('click', () => {
  menu.classList.toggle('fa-times');
  navbar.classList.toggle('active');
});
selectLang.addEventListener('change', changeURLLanguage);
function changeURLLanguage() {
  let lang = selectLang.value;
  location.href = window.location.pathname + '#' + lang;
  let hash = window.location.hash;
  hash = hash.substr(1);
  console.log(langArr);
  if (!allLang.includes(hash)) {
    location.href = window.location.pathname + '#eng';
  }
  for (let key in langArr) {
    document.querySelector('.lang-' + key).innerHTML = langArr[key][hash];
    if (hash === 'ukr') {
      document.querySelector('.header .header__navigation ul').style.padding = '20px 51px';
      document.querySelector('.header .header__site-language').style.paddingRight = '51px';
      document.querySelector('.header-parallax__text-container .header-parallax__title').style.paddingRight = '115px';
    } else {
      document.querySelector('.header .header__navigation ul').style.padding = '20px 100px';
      document.querySelector('.header .header__site-language').style.paddingRight = '100px';
      document.querySelector('.header-parallax__text-container .header-parallax__title').style.paddingRight = '36px';
    }
  }
}
window.onscroll = () => {
  menu.classList.remove('fa-times');
  navbar.classList.remove('active');
  section.forEach(section => {
    let top = window.scrollY;
    let height = section.offsetHeight;
    let offset = section.offsetTop - 150;
    let id = section.getAttribute('id');
    // console.log(top)
    // console.log(height)
    // console.log(offset)
    // console.log(id)
    if (top >= offset && top < offset + height) {
      navLinks.forEach(links => {
        links.classList.remove('active');
        document.querySelector('.header__navigation ul li a[href*=' + id + ']').classList.add('active');
      });
    }
  });
};
setInterval(function () {
  const show = document.querySelector('span[data-show]');
  const next = show.nextElementSibling || document.querySelector('.mask span:first-child');
  const up = document.querySelector('span[data-up]');
  if (up) {
    up.removeAttribute('data-up');
  }
  show.removeAttribute('data-show');
  show.setAttribute('data-up', '');
  next.setAttribute('data-show', '');
}, 2000);
tabsLink.forEach(onTabClick);
function onTabClick(item) {
  item.addEventListener('click', function () {
    let currentTab = item;
    let tabId = currentTab.getAttribute('data-tab');
    let currentItem = document.querySelector(tabId);
    // console.log(currentItem)

    if (!currentTab.classList.contains('active-link')) {
      tabsLink.forEach(function (item) {
        item.classList.remove('active-link');
      });
      tabsItem.forEach(function (item) {
        item.classList.remove('active-tab');
      });
      currentTab.classList.add('active-link');
      currentItem.classList.add('active-tab');
    }
  });
}
document.querySelector('.about-row__tabs-link').click();
window.onload = function () {
  const parallax = document.querySelector('.header-parallax');
  if (parallax) {
    const content = document.querySelector('.header-parallax__text-container');
    const parIcons = document.querySelector('.images-parallax_icons');
    const parIconsGrey = document.querySelector('.images-parallax_icons-greyscale');
    const parHuman = document.querySelector('.images-parallax_humans');
    const forIcons = 40;
    const forIconsGrey = 20;
    const forHuman = 10;
    const speed = 0.05;
    let positionX = 0,
      positionY = 0;
    let coordXprocent = 0,
      coordYprocent = 0;
    function setMouseParallaxStyle() {
      const distX = coordXprocent - positionX;
      const distY = coordYprocent - positionY;
      positionX = positionX + distX * speed;
      positionY = positionY + distY * speed;
      parIcons.style.cssText = `transform: translate(${positionX / forIcons}%,${positionY / forIcons}%)`;
      parIconsGrey.style.cssText = `transform: translate(${positionX / forIconsGrey}%,${positionY / forIconsGrey}%)`;
      parHuman.style.cssText = `transform: translate(${positionX / forHuman}%,${positionY / forHuman}%)`;
      requestAnimationFrame(setMouseParallaxStyle);
    }
    setMouseParallaxStyle();
    parallax.addEventListener('mousemove', function (e) {
      const parallaxWidth = parallax.offsetWidth;
      const parallaxHeight = parallax.offsetHeight;
      const coordX = e.pageX - parallaxWidth / 2;
      const coordY = e.pageY - parallaxHeight / 2;
      coordXprocent = coordX / parallaxWidth * 100;
      coordYprocent = coordY / parallaxHeight * 100;
    });
    let thresholdSets = [];
    for (let i = 0; i < 1.0; i += 0.005) {
      thresholdSets.push(i);
    }
    const callback = function (entries, observer) {
      const scrollTopProcent = window.pageYOffset / parallax.offsetHeight * 100;
      setParallaxItemStyle(scrollTopProcent);
    };
    const observer = new IntersectionObserver(callback, {
      threshold: thresholdSets
    });
    observer.observe(document.querySelector('.about'));
    function setParallaxItemStyle(scrollTopProcent) {
      content.style.cssText = `transform: translate(0%, -${scrollTopProcent / 9}%)`;
      parIconsGrey.parentElement.style.cssText = `transform: translate(0%, -${scrollTopProcent / 9}%)`;
      parHuman.parentElement.style.cssText = `transform: translate(0%, -${scrollTopProcent / 3}%)`;
    }
  }
};

